import React from 'react';
import { Link } from "react-router-dom";

function Header() {
  return (
    <div>
      <ul>
        <li>
          <Link to="/Pass">Aladin</Link>
        </li>
        <li>
          <Link to="/Giftrip">Lion King</Link>
        </li>
      </ul>
    </div>
  )
}

export default Header;
